    "SoundCloud",

    "MainDataBase"
]

const apisMap = {
    "YouTube" : youTubeApi,
    "SoundCloud" : null,

    "MainDataBase" : userApi
}

export function getApi(apiName){
    return apisMapp[apiName];
}

export function getAvailableApis(){
    return availableApis;
}

